import { Switch, TextField } from "@mui/material";
import axios from "axios";
import { useEffect, useState } from "react";

const ByeSell = () => {
  const [state, setState] = useState([true, true, true, true]);
  const [dstate, setDstate] = useState({
    datas: [],
  });

  useEffect(() => {
    getData();
  }, []);

  const getData = () => {
    axios
      .get("https://forbit.tech/sohel/sohel/coins")
      .then((res) => {
        const data = res.data;
        const old = { ...dstate };
        old.datas = data;
        console.log(data);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  const handleChange = (i) => {
    const old = [...state];
    old[i] = !old[i];
    setState(old);
    alert("button Clicked");

    console.log(old[i] ? `Switch ${i + 1} On` : `Switch ${i + 1} Off`);
  };

  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      {dstate.datas.map((item, i) => {
        <div
          style={{
            height: "50%",
            width: "90%",
            background: "white",
            display: "flex",
          }}
        >
          <div
            style={{
              flex: 5,
              display: "flex",
              padding: 10,
              boxShadow:
                "rgba(50, 50, 93, 0.25) 0px 50px 100px -20px, rgba(0, 0, 0, 0.3) 0px 30px 60px -30px, rgba(10, 37, 64, 0.35) 0px -2px 6px 0px inset",
            }}
          >
            <div
              style={{
                flex: 5,
                display: "flex",
                alignItems: "center",
                justifyContent: "space-around",
                flexDirection: "column",
              }}
            >
              <h1
                style={{
                  fontSize: 22,
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                  boxShadow: "rgba(0, 0, 0, 0.1) 0px 10px 50px",
                }}
              >
                COIN NAME
              </h1>
              <h1
                style={{
                  fontSize: 22,
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "left",
                }}
              >
                BUYING AMOUNT
              </h1>
              <h1
                style={{
                  fontSize: 22,
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "left",
                }}
              >
                SELLING AMOUNT
              </h1>
              <h1
                style={{
                  fontSize: 22,
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "left",
                }}
              >
                GRID AMOUNT
              </h1>
            </div>
            <div
              style={{
                flex: 5,
                display: "flex",
                alignItems: "center",
                justifyContent: "space-around",
                flexDirection: "column",
              }}
            >
              <div
                style={{
                  height: "15%",
                  width: "60%",
                  boxShadow:
                    "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  borderRadius: 8,
                }}
              >
                {item.name}
              </div>
              <div
                style={{
                  height: "15%",
                  width: "60%",
                  boxShadow:
                    "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  borderRadius: 8,
                }}
              >
                div_2
              </div>
              <div
                style={{
                  height: "15%",
                  width: "60%",
                  boxShadow:
                    "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  borderRadius: 8,
                }}
              >
                div_3
              </div>
              <div
                style={{
                  height: "15%",
                  width: "60%",

                  boxShadow:
                    "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  borderRadius: 8,
                }}
              >
                div_4
              </div>
            </div>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              padding: 10,
              boxShadow:
                "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
            }}
          >
            {" "}
            <div
              style={{
                flex: 5,
                display: "flex",
                alignItems: "center",
                justifyContent: "space-around",
                flexDirection: "column",
              }}
            >
              <h1
                style={{
                  fontSize: 22,
                  alignItems: "center",
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                AUTO SELLING
              </h1>
              <h1
                style={{
                  fontSize: 22,
                  alignItems: "center",
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                AUTO BUYING
              </h1>
              <h1
                style={{
                  fontSize: 22,
                  alignItems: "center",
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                SELLING AMOUNT
              </h1>
              <h1
                style={{
                  fontSize: 22,
                  alignItems: "center",
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                GRID AMOUNT
              </h1>
            </div>
            <div
              style={{
                flex: 5,
                display: "flex",
                alignItems: "center",
                justifyContent: "space-around",
                flexDirection: "column",
              }}
            >
              {state.map((isChecked, i) => (
                <div
                  key={i}
                  style={{
                    height: "15%",
                    width: "60%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    borderRadius: 8,
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px,rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  <Switch
                    onChange={() => handleChange(i)}
                    checked={isChecked}
                  />
                </div>
              ))}
            </div>
          </div>
        </div>;
      })}
    </div>
  );
};

export default ByeSell;
